(1, 'Màn hình super Retina XDR, OLED, 460 ppi, HDR display, ', '16GB', '128GB', '11', 'IOS', '6.1', '174g', 'Camera góc rộng: 12MP, f/1.6 Camera góc siêu rộng: 12MP', 'Có', 'Wi‑Fi 6 (802.11ax)', '3,095mAh', '1', 'GPS, GLONASS, Galileo, QZSS, and BeiDou', '4G,5G', '2021-11-02', 'v5.0', '1', '4K 2160p@30fps', '1', '<h3 style=\"margin-bottom: 15px; font-variant-numeric: normal; font-variant-east-asian: normal; font-weight: bold; font-stretch: normal; font-size: 20px; line-height: 28px; font-family: Arial, Helvetica, sans-serif; color: rgb(51, 51, 51); outline: none;\"><a href=\"https://www.thegioididong.com/apple\" target=\"_blank\" title=\"Tham khảo sản phẩm chính hãng của Apple tại Thế Giới Di Động\" style=\"transition: all 0.2s ease 0s; color: rgb(47, 128, 237); font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 18px; outline: none;\">Apple</a> thỏa mãn sự chờ đón của iFan và người dùng với sự ra mắt của <a href=\"https://www.thegioididong.com/dtdd/iphone-13-256gb\" target=\"_blank\" title=\"Tham khảo iPhone 13 256 GB có tại Thế Giới Di Động\" style=\"transition: all 0.2s ease 0s; color: rgb(47, 128, 237); font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 18px; outline: none;\">iPhone 13</a>. Dù ngoại hình không có nhiều thay đổi so với <a href=\"https://www.thegioididong.com/dtdd/iphone-12\" target=\"_blank\" title=\"Tham khảo iPhone 12 kinh doanh tại Thegioididong.com\" style=\"transition: all 0.2s ease 0s; color: rgb(47, 128, 237); font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 18px; outline: none;\">iPhone 12</a> nhưng với cấu hình mạnh mẽ hơn, đặc biệt pin “trâu” hơn và khả năng quay phim chụp ảnh cũng ấn tượng hơn, hứa hẹn mang đến những trải nghiệm thú vị trên phiên bản mới này.</h3><h3 style=\"margin-bottom: 15px; font-variant-numeric: normal; font-variant-east-asian: normal; font-weight: bold; font-stretch: normal; font-size: 20px; line-height: 28px; font-family: Arial, Helvetica, sans-serif; color: rgb(51, 51, 51); outline: none; text-align: justify;\">Hiệu năng đột phá cùng bộ xử lý Apple A15 Bionic</h3><p><p style=\"margin-block: 0px; text-rendering: geometricprecision; line-height: 1.5; font-family: Arial, Helvetica, sans-serif; text-align: justify; font-size: 16px !important;\"><a class=\"preventdefault\" href=\"https://www.thegioididong.com/images/42/250258/iphone-13-256gb-1.jpg\" style=\"transition: all 0.2s ease 0s; color: rgb(47, 128, 237); cursor: default;\"></a></p></p><p style=\"box-sizing: border-box; margin: 0px 0px 10px; padding: 0px; margin-block: 0px; margin-inline: 0px; text-rendering: geometricprecision; font-size: 16px !important; line-height: 1.5; color: rgb(51, 51, 51); font-family: Arial, Helvetica, sans-serif; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; text-align: justify;\">Bộ vi xử lý<span> </span><a href=\"https://www.thegioididong.com/hoi-dap/tim-hieu-chip-apple-a15-bionic-suc-manh-cuc-khung-duoc-he-1339072\" target=\"_blank\" title=\"Tìm hiểu thêm về bộ xử lý Apple A15 Bionic \" style=\"box-sizing: border-box; margin: 0px; padding: 0px; text-decoration: none; transition: all 0.2s ease 0s; color: rgb(47, 128, 237); font-size: 16px !important; text-align: justify;\">Apple A15</a> mới gia tăng tốc độ CPU tới 50% và GPU đồ họa nhanh hơn 30% so với các đối thủ cạnh tranh trong cùng phân khúc, giúp iPhone 13 thể hiện sức mạnh khả năng xử lý ấn tượng hơn, mượt mà trên mọi tác vụ.</p><p> </p><h3 style=\"margin-bottom: 15px; font-variant-numeric: normal; font-variant-east-asian: normal; font-weight: bold; font-stretch: normal; font-size: 20px; line-height: 28px; font-family: Arial, Helvetica, sans-serif; color: rgb(51, 51, 51); outline: none; text-align: justify;\">Màn hình Super Retina XDR sắc nét, siêu sáng</h3><p style=\"margin-block: 0px; text-rendering: geometricprecision; line-height: 1.5; font-family: Arial, Helvetica, sans-serif; font-size: 16px !important;\"><span style=\"text-align: justify;\">iPhone 13 dùng tấm nền OLED chất lượng cao cho màn hình 6.1 inch, có mật độ điểm ảnh lớn, gam màu rộng, độ phân giải cao đến 1170 x 2532 Pixels tạo ra những khung hình vượt trội về độ nét, sống động trong từng chi tiết, chân thực hơn ở mọi góc nhìn.</span></p><ol><li style=\"margin-block: 0px; text-rendering: geometricprecision; line-height: 1.5; font-family: Arial, Helvetica, sans-serif; font-size: 16px !important;\"><span style=\"text-align: justify;\"><br><div style=\"text-align: center;\"><img src=\"https://cdn.tgdd.vn/Products/Images/42/250258/iphone-13-256gb-6.jpg\" style=\"text-align: left; width: 50%;\"></div></span></li></ol>'),
(3, 'super AMOLED 6.7 inch, Full HD+', '16GB', '128GB', '2 nhân 2.2 GHz & 6 nhân 1.8 GHz', 'Windows Phone', ' 6.7', '179 g', '64 MP + 12 MP + 5 MP + 5 MP', 'Có', ' Dual-band (2.4 GHz/5 GHz)  Wi-Fi 802.11 a/b/g/n/ac  Wi', ' 4500 mAh', '1 tháng sau khi mua sản phẩm', 'GPS  BDS  GLONASS', ' Hỗ trợ 4G', '2017-01-02', 'A2DPv5.0', 'Có (microphone chuyên dụng chống ồn)', '4K 2160p@30fps', '1', '<h2 style=\"margin-top: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-weight: bold; font-stretch: normal; font-size: 16px; line-height: 18px; font-family: Arial, Helvetica, sans-serif; color: rgb(51, 51, 51); outline: none;\">Sau A51,&nbsp;<a href=\"https://www.thegioididong.com/dtdd-samsung\" target=\"_blank\" title=\"Xem thêm các mẫu Điện thoại Samsung đang kinh doanh tại Thegioididong.com\" type=\"Xem thêm các mẫu Điện thoại Samsung đang kinh doanh tại Thegioididong.com\" style=\"transition: all 0.2s ease 0s; color: rgb(47, 128, 237); font-variant-numeric: normal; font-variant-east-asian: normal; font-weight: normal; font-stretch: normal; line-height: 18px; outline: none;\">Samsung</a>&nbsp;tiếp tục ra mắt<a href=\"https://www.thegioididong.com/dtdd/samsung-galaxy-a71\" target=\"_blank\" title=\"Điện thoại Samsung Galaxy A71\" type=\"Điện thoại Samsung Galaxy A71\" style=\"transition: all 0.2s ease 0s; color: rgb(47, 128, 237); font-variant-numeric: normal; font-variant-east-asian: normal; font-weight: normal; font-stretch: normal; line-height: 18px; outline: none;\">&nbsp;Galaxy A71</a>&nbsp;là đại diện kế tiếp thuộc thế hệ smartphone Galaxy A 2020. Máy được cải tiến với camera macro siêu cận đột phá, camera chính lên đến 64 MP cùng thiết kế thời thượng và cao cấp.</h2><h3 style=\"margin-bottom: 15px; font-variant-numeric: normal; font-variant-east-asian: normal; font-weight: bold; font-stretch: normal; font-size: 20px; line-height: 28px; font-family: Arial, Helvetica, sans-serif; color: rgb(51, 51, 51); outline: none;\">Màn hình lớn, trải nghiệm tràn viền cực đã</h3><p style=\"margin-block: 0px; text-rendering: geometricprecision; line-height: 1.5; font-family: Arial, Helvetica, sans-serif; font-size: 16px !important;\">Galaxy A71 sở hữu&nbsp;<a href=\"https://www.thegioididong.com/dtdd-man-hinh-tran-vien\" target=\"_blank\" title=\"Điên thoại có màn hình tràn viền tại Thegioididong.com\" type=\"Điên thoại có màn hình tràn viền tại Thegioididong.com\" style=\"transition: all 0.2s ease 0s; color: rgb(47, 128, 237);\">màn hình tràn viền</a>&nbsp;Infinity-O với rãnh camera được đặt chính giữa tương tự như trên flagship&nbsp;<a href=\"https://www.thegioididong.com/dtdd/samsung-galaxy-note-10\" target=\"_blank\" title=\"Xem chi tiết Samsung Galaxy Note 10\" type=\"Xem chi tiết Samsung Galaxy Note 10\" style=\"transition: all 0.2s ease 0s; color: rgb(47, 128, 237);\">Note 10</a>. Điểm cộng là phần rãnh camera nay đã được làm rất nhỏ, ít gây chú ý, cho trải nghiệm hình ảnh thoải mái và ít bị phân tâm hơn.</p><p style=\"text-align: center; margin-block: 0px; text-rendering: geometricprecision; line-height: 1.5; font-family: Arial, Helvetica, sans-serif; font-size: 16px !important;\"><img src=\"https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQilRpHJYAL4Bczlybk5-5fI6MujZT2JuB72g&amp;usqp=CAU\" style=\"width: 50%;\"></p><h3 style=\"margin-bottom: 15px; font-variant-numeric: normal; font-variant-east-asian: normal; font-weight: bold; font-stretch: normal; font-size: 20px; line-height: 28px; font-family: Arial, Helvetica, sans-serif; color: rgb(51, 51, 51); outline: none;\">Dẫn đầu xu hướng thiết kế 2020</h3><p style=\"margin-block: 0px; text-rendering: geometricprecision; line-height: 1.5; font-family: Arial, Helvetica, sans-serif; font-size: 16px !important;\">Tổng thể&nbsp;<a href=\"https://www.thegioididong.com/dtdd\" target=\"_blank\" title=\"Tham khảo điện thoại thông minh kinh doanh tại Thegioididong.com\" style=\"transition: all 0.2s ease 0s; color: rgb(47, 128, 237);\">điện thoại thông minh</a>&nbsp;Samsung Galaxy A71 toát lên vẻ sang trọng và thời thượng, sở hữu mặt lưng bóng bẩy với họa tiết vân hình kim cương nổi bật phía sau. Hiệu ứng chuyển màu cũng được làm rất vừa phải và tinh tế.</p><h3 style=\"margin-bottom: 15px; font-variant-numeric: normal; font-variant-east-asian: normal; font-weight: bold; font-stretch: normal; font-size: 20px; line-height: 28px; font-family: Arial, Helvetica, sans-serif; color: rgb(51, 51, 51); outline: none;\">Hệ điều hành cao cấp trên sản phẩm tầm trung</h3><p style=\"margin-block: 0px; text-rendering: geometricprecision; line-height: 1.5; font-family: Arial, Helvetica, sans-serif; font-size: 16px !important;\">Samsung Galaxy A71 ra mắt chạy hệ điều hành Android 10 với giao diện người dùng OneUI 2.0. Samsung nói rằng họ đã tối ưu phần mềm theo hướng đề cao sự tiện lợi, giúp khách hàng có thể sử dụng dễ dàng bằng một tay và thiết kế tinh gọn, nhẹ nhàng.</p>'),
(9, 'Màn hình super Retina XDR, OLED, 460 ppi, HDR display, ', '2GB', '3GB', 'Octa-core (2x2.73 GHz Mongoose M5 & 2x2.50 GHz Cortex-A', 'Android', '5.9', '194 g', 'AI Camera Ban đêm (Night Mode) Chuyên nghiệp (Pro) Chạm', 'MicroSD, hỗ trợ lên đến 1TB', '802.11ax Wi‑Fi 6 with 2x2 MIMO', '3110 mAh', '1 tháng sau khi mua sản phẩm', 'GPS, GLONASS, Galileo, QZSS, and BeiDou', 'Hỗ trợ 4G', '2021-02-21', '5.0, A2DP, LE, aptX', 'Có (microphone chuyên dụng chống ồn)', '4K 2160p@30fps FullHD 1080p@30fps FullHD 1080p@60fps HD', '1', '<h2 style=\"margin-top: 0px; margin-bottom: 0.5rem; font-family: sans-serif; font-weight: 700; line-height: 1.2; color: rgb(10, 38, 60); font-size: 21px;\">Điện thoại Xiaomi Mi 11 - Màn hình tràn viền ấn tượng cùng hiệu năng cao cấp</h2><p style=\"font-size: 15px; line-height: 1.5; color: rgb(68, 68, 68); font-family: sans-serif;\">Một trong những chiếc smartphone được các Mi Fan mong chờ nhất năm nay đó chính là&nbsp;<strong>Xiaomi Mi 11</strong>. Trang bị vi xử lý Snapdragon 888 hỗ trợ 5G với thiết kế màn hình tràn viền ấn tượng, đây sẽ là chiếc flagship nổi bật của Xiaomi trong năm nay. Ngoài ra, bạn cũng có thể tham khảo thêm&nbsp;<a href=\"https://cellphones.com.vn/xiaomi-mi-11-lite.html\" style=\"color: rgb(215, 0, 24);\">điện thoại Mi 11 Lite</a>&nbsp;khả năng cao sẽ được bán tại CellphoneS trong thời gian gần nhất.</p><h3 style=\"margin-top: 0px; margin-bottom: 0.5rem; font-family: sans-serif; line-height: 1.2; color: rgb(10, 38, 60); font-size: 1.75rem;\">Khung viền kim loại, màn hình 6.81 inch tần số quét 120Hz</h3><p style=\"font-size: 15px; line-height: 1.5; color: rgb(68, 68, 68); font-family: sans-serif;\">Tính sang trọng chuẩn flagship của Mi 11 được thể hiện đầu tiên qua thiết kế vuông vức bốn góc cạnh đầy lịch lãm. Máy còn có độ cứng cáp nhờ chất liệu kim loại sang trọng cùng kính cường lực phủ đều hai mặt trước &amp; sau. Độ mỏng ấn tượng cũng là một điểm đáng chú ý trên thiết kế thân máy.</p><p style=\"text-align: center; font-size: 15px; line-height: 1.5; color: rgb(68, 68, 68); font-family: sans-serif;\">Màn hình còn là một trong những điểm thu hút trên Xiaomi Mi 11. Mang thiết kế cong tràn viền ấn tượng, màn hình có kích thước 6.81 inch, độ phân giải&nbsp;QHD+ trên nền AMOLED và bao phủ gần như trọn mặt trước của máy. Tỷ lệ hiển thị lớn, cùng tần số quét đến 120Hz sẽ làm cho chất lượng hình ảnh trông chân thực nhất.<img src=\"https://cdn.cellphones.com.vn/media/wysiwyg/mobile/huawei/xiaomi-mi-11-2.jpg\" style=\"width: 840px;\"></p><p style=\"font-size: 15px; line-height: 1.5; color: rgb(68, 68, 68); font-family: sans-serif;\">Xiaomi Mi 11 sẽ được trang bị camera selfie có độ phân giải 20MP. Camera này vẫn được thiết kế ở dạng nuốt rồi, thiết kế này góp phần tăng diện tích hiển thị hình ảnh mà còn làm nên vẻ đẹp cuốn hút của điện thoại.</p><h3 style=\"margin-top: 0px; margin-bottom: 0.5rem; font-family: sans-serif; line-height: 1.2; color: rgb(10, 38, 60); font-size: 1.75rem;\">Vi xử lý Snapdragon 888 hỗ trợ mạng 5G, bộ nhớ RAM 8 GB</h3><p style=\"font-size: 15px; line-height: 1.5; color: rgb(68, 68, 68); font-family: sans-serif;\"><strong>Mi 11</strong>&nbsp;sẽ là chiếc smartphone Trung Quốc đầu tiên trang bị vi xử lý Qualcomm Snapdragon 888 tương tự như&nbsp;<a href=\"https://cellphones.com.vn/xiaomi-mi-11-pro.html\" style=\"color: rgb(215, 0, 24);\">điện thoại Mi 11 Pro</a>&nbsp;vừa ra mắt. Đây là bộ vi xử lý mới nhất đến từ hãng Qualcomm, được sản xuất trên tiến trình 5 nm và sẽ có 8 lõi, mang đến hiệu năng mạnh mẽ cho mọi tác vụ công việc &amp; giải trí. Ngoài ra Snapdragon 888 còn hỗ trợ vận hành mạng viễn thông 5G tiên tiến trong thời gian sắp tới.</p>'),
(10, 'Dynamic AMOLED', '16GB', '2GB', 'Hexa-core', 'Android', '6.1', '174g', 'AI Camera Ban đêm (Night Mode) Chuyên nghiệp (Pro) Chạm', 'MicroSD, hỗ trợ lên đến 1TB', 'Wi-Fi 802.11 a/b/g/n/ac/6, dual-band, Wi-Fi Direct, hot', 'Non-removable Li-Ion 4500 mAh battery Fast charging 25W', '1 tháng sau khi mua sản phẩm', 'A-GPS, GLONASS, BDS, GALILEO', 'Hỗ trợ 4G,5G', '2021-11-11', '5.0, A2DP, LE, aptX', 'Mới nhất hiện nay', '4K 2160p@30fps', '1', '<h2 style=\"margin-top: 0px; margin-bottom: 0.5rem; font-family: sans-serif; font-weight: 700; line-height: 1.2; color: rgb(10, 38, 60); font-size: 21px;\"><strong>Điện thoại Vivo X60 Pro - Siêu phẩm mới từ thương hiệu Vivo không thể bỏ lỡ</strong></h2><p style=\"font-size: 15px; line-height: 1.5; color: rgb(68, 68, 68); font-family: sans-serif;\"><a href=\"https://cellphones.com.vn/mobile/vivo.html\" style=\"color: rgb(215, 0, 24);\">Vivo</a>&nbsp;là cái tên không còn xa lạ trên thị trường smartphone hiện nay với nhiều dòng điện thoại chất lượng trong phân khúc tầm trung. Và&nbsp;<strong>Vivo X60 Pro</strong>&nbsp;tiếp tục là sản phẩm nối tiếp thế hệ trước vừa được ra mắt với nhiều ưu điểm trong thiết kế và cấu hình phù hợp với thị hiếu người dùng hiện nay.</p><p style=\"font-size: 15px; line-height: 1.5; color: rgb(68, 68, 68); font-family: sans-serif;\">Ngoài ra, bạn cũng có thể tham khảo thêm&nbsp;<a href=\"https://cellphones.com.vn/vivo-x70-pro.html\" style=\"color: rgb(215, 0, 24);\">điện thoại Vivo X70 Pro</a>&nbsp;với nhiều nâng cấp về cấu hình lẫn camera.</p><h3 style=\"margin-top: 0px; margin-bottom: 0.5rem; font-family: sans-serif; line-height: 1.2; color: rgb(10, 38, 60); font-size: 1.75rem;\"><strong>Thiết kế sang trọng, màn hình AMOLED Full HD+</strong></h3><p style=\"font-size: 15px; line-height: 1.5; color: rgb(68, 68, 68); font-family: sans-serif;\">Chiếc smartphone này sẽ không làm người dùng thất vọng vì như các dòng điện thoại khác của hãng, X60 Pro thế hệ mới tiếp tục được thiết kế với vẻ ngoài thanh lịch cùng kích thước nhỏ gọn rất thuận tiện để mang theo.</p><p style=\"font-size: 15px; line-height: 1.5; color: rgb(68, 68, 68); font-family: sans-serif;\">Chiếc smartphone có độ mỏng vừa phải với các đường viền xung quanh được làm rất tỉ mỉ tạo nên cảm giác rất sang trọng và đầy tính thẩm mỹ.</p><p style=\"font-size: 15px; line-height: 1.5; color: rgb(68, 68, 68); font-family: sans-serif;\">Ngoài ra, trọng lượng 178g tạo sự gọn nhẹ rất thích hợp để mang đi xa.</p><p style=\"font-size: 15px; line-height: 1.5; color: rgb(68, 68, 68); font-family: sans-serif;\">Về màu sắc, với Vivo X60 Pro, hãng đã đưa ra hai sự lựa chọn là màu xám và màu aurora. Mỗi tông màu đều mang nét đẹp riêng nhưng nhìn chung đều thể hiện đúng tinh thần của hãng là tạo nên sự sang trọng và hiện đại.</p><p style=\"font-size: 15px; line-height: 1.5; color: rgb(68, 68, 68); font-family: sans-serif;\">Về chất liệu, Vivo X60 Pro được thiết kế nguyên khối với khung nhôm cao cấp và mặt lưng kính cường lực có độ bền và chịu lực cực cao. Nhờ đó, khi cầm chiếc điện thoại trong tay, bạn sẽ thấy rất cứng cáp và chắc chắn.</p><p style=\"font-size: 15px; line-height: 1.5; color: rgb(68, 68, 68); font-family: sans-serif;\">Tiếp theo, về màn hình, siêu phẩm mới từ thương hiệu Vivo được trang bị một màn hình \"nốt ruồi\", sử dụng tấm nền E3 AMOLED với kích thước là 6.56 inch cùng độ phân giải cao, cực kỳ ấn tượng là 1080 x 2376 Pixels.</p><p style=\"font-size: 15px; line-height: 1.5; color: rgb(68, 68, 68); font-family: sans-serif;\">Ngoài ra, với phiên bản Pro, bạn sẽ được ngắm nhìn màn hình cong 2 cạnh bên rất đẹp mắt. Độ phân giải Full HD+ cho phép người dùng có những phút giây trải nghiệm thị giác rất chân thực và thú vị vì hình ảnh sắc nét.</p><div><p style=\"font-size: 15px; line-height: 1.5; color: rgb(68, 68, 68); font-family: sans-serif;\">Bên cạnh đó, màn hình còn được hỗ trợ bởi HDR10+ cùng tần số quét 120Hz. Điều này đồng nghĩa với việc chất lượng khung hình được nâng lên tối đa cũng như các thao tác diễn ra rất mượt mà, trơn tru.</p><h3 style=\"margin-top: 0px; margin-bottom: 0.5rem; font-family: sans-serif; line-height: 1.2; color: rgb(10, 38, 60); font-size: 1.75rem;\"><strong>Hiệu năng mạnh mẽ</strong><strong>&nbsp;với chip&nbsp;Snapdragon 870 5G</strong><strong></strong></h3><p style=\"font-size: 15px; line-height: 1.5; color: rgb(68, 68, 68); font-family: sans-serif;\">Khác với thế hệ trước đó, Vivo X60 Pro thế hệ mới sẽ dùng chipset của Qualcomm là chip&nbsp;Snapdragon 870 5G.&nbsp;Với chip xử lý trên, bạn sẽ không còn phải lo hiện tượng giật lag hay gián đoạn khung hình khi sử dụng vì các tác vụ được thực hiện một cách nhịp nhàng. Chiếc điện thoại có thể dễ dàng đa nhiệm nhiều tác vụ cùng lúc.</p></div>'),
(11, 'Dynamic AMOLED', '16GB', '128GB', 'Hexa-core', 'Android', '6.5', '222 g', 'Camera góc rộng: 12MP, f/1.6 Camera góc siêu rộng: 12MP', 'Có hỗ trợ', 'Wi-Fi 802.11 a/b/g/n/ac/6, dual-band, Wi-Fi Direct, hot', '3110 mAh', '3 tháng sau khi mua sản phẩm', 'GPS/GNSS', 'Hỗ trợ 4G,5G', '2021-01-01', 'A2DPv5.0', 'Có (microphone chuyên dụng chống ồn)', '1080p@30fps', '2', '<h3 style=\"margin-bottom: 15px; font-variant-numeric: normal; font-variant-east-asian: normal; font-weight: bold; font-stretch: normal; font-size: 20px; line-height: 28px; font-family: Arial, Helvetica, sans-serif; color: rgb(51, 51, 51); outline: none;\"><a href=\"https://www.thegioididong.com/dtdd-xiaomi\" target=\"_blank\" title=\"Tham khảo điện thoại Xiaomi tại Thegioididong.com\" style=\"transition: all 0.2s ease 0s; color: rgb(47, 128, 237); font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 18px; outline: none;\">Xiaomi</a> đã tung ra chiếc điện thoại với mọi tính năng cực kỳ ấn tượng, lại nằm trong mức giá tầm trung đầy ưu đãi thuộc dòng Redmi Note kế tiếp, đó là <a href=\"https://www.thegioididong.com/dtdd/xiaomi-redmi-note-10-pro-6gb-128gb\" target=\"_blank\" title=\"Tham khảo Xiaomi Redmi Note 10 Pro tại Thegioididong.com\" style=\"transition: all 0.2s ease 0s; color: rgb(47, 128, 237); font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 18px; outline: none;\">Xiaomi Redmi Note 10 Pro (6GB/128GB)</a>, hứa hẹn mang đến sự cạnh tranh lớn trong cùng phân khúc. </h3><h3 style=\"margin-bottom: 15px; font-variant-numeric: normal; font-variant-east-asian: normal; font-weight: bold; font-stretch: normal; font-size: 20px; line-height: 28px; font-family: Arial, Helvetica, sans-serif; color: rgb(51, 51, 51); outline: none;\">Cấu tạo chắc chắn và hiện đại </h3><p></p><p style=\"margin-block: 0px; text-rendering: geometricprecision; line-height: 1.5; font-family: Arial, Helvetica, sans-serif; font-size: 16px !important;\"><a class=\"preventdefault\" href=\"https://www.thegioididong.com/images/42/235938/xiaomi-redmi-note-10-pro-002.jpg\" style=\"transition: all 0.2s ease 0s; color: rgb(47, 128, 237); cursor: default;\"></a></p><p></p><p style=\"text-align: center; box-sizing: border-box; margin: 0px 0px 10px; padding: 0px; margin-block: 0px; margin-inline: 0px; text-rendering: geometricprecision; line-height: 1.5; color: rgb(51, 51, 51); font-family: Arial, Helvetica, sans-serif; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; font-size: 16px !important;\">Xiaomi Redmi Note 10 Pro có thiết kế nguyên khối mang lại cảm giác rắn chắc. Chiếc điện thoại được bảo vệ hoàn hảo cả hai mặt bởi kính cường lực mang khả năng chống chịu va đập tốt, hạn chế vết nứt khi va chạm với bề mặt cứng và các trầy xước không mong muốn. <img src=\"https://cdn.tgdd.vn/Products/Images/42/235938/xiaomi-redmi-note-10-pro-002.jpg\" style=\"width: 800px;\"></p><p style=\"margin-block: 0px; text-rendering: geometricprecision; line-height: 1.5; font-family: Arial, Helvetica, sans-serif; font-size: 16px !important;\">Bên cạnh đó, màn hình của Redmi Note 10 Pro sở hữu tần số quét lên đến 120 Hz mà ít điện thoại nào trong cùng phân khúc giá có được, giúp người dùng có được trải nghiệm mượt mà, nhanh chóng.</p><h3 style=\"margin-bottom: 15px; font-variant-numeric: normal; font-variant-east-asian: normal; font-weight: bold; font-stretch: normal; font-size: 20px; line-height: 28px; font-family: Arial, Helvetica, sans-serif; color: rgb(51, 51, 51); outline: none;\">Độ phân giải máy ảnh cao đáng kinh ngạc</h3><p style=\"margin-block: 0px; text-rendering: geometricprecision; line-height: 1.5; font-family: Arial, Helvetica, sans-serif; font-size: 16px !important;\">Xiaomi Redmi Note 10 Pro sẽ để lại ấn tượng sâu sắc trong lòng mọi người dùng yêu chụp ảnh với thông số camera chính lên đến 108 MP, <a href=\"https://www.thegioididong.com/hoi-dap/camera-goc-rong-goc-sieu-rong-tren-smartphone-la-1172240\" target=\"_blank\" title=\"Camera góc rộng, góc siêu rộng trên smartphone là gì?\" style=\"transition: all 0.2s ease 0s; color: rgb(47, 128, 237);\">camera góc rộng</a> 118 độ 8 MP, <a href=\"https://www.thegioididong.com/hoi-dap/che-do-chup-macro-la-gi-907851\" target=\"_blank\" title=\"Ống kính Macro, chụp ảnh Macro là gì? Các lưu ý khi chụp ảnh Macro\" style=\"transition: all 0.2s ease 0s; color: rgb(47, 128, 237);\">camera macro</a> 5 MP và camera đo độ sâu 2 MP.</p><p style=\"margin-block: 0px; text-rendering: geometricprecision; line-height: 1.5; font-family: Arial, Helvetica, sans-serif; font-size: 16px !important;\">Camera mặt trước có độ phân giải 16 MP, máy hỗ trợ các tính năng <a href=\"https://www.thegioididong.com/hoi-dap/che-do-lam-dep-beautify-tren-smartphone-tablet-1172231\" target=\"_blank\" title=\"Chế độ làm đẹp (Beautify) trên smartphone, tablet là gì?\" style=\"transition: all 0.2s ease 0s; color: rgb(47, 128, 237);\">làm đẹp</a>, <a href=\"https://www.thegioididong.com/hoi-dap/che-do-autofocus-trong-chup-anh-tren-smartphone-906408\" target=\"_blank\" title=\"Chế độ autofocus trong chụp ảnh trên smartphone\" style=\"transition: all 0.2s ease 0s; color: rgb(47, 128, 237);\">tự động lấy nét</a> giúp mang lại khả năng selfie bắt mắt, chụp đẹp trong vòng “một nốt nhạc” mà không cần phải tốn nhiều thời gian chỉnh sửa ảnh.</p><h3 style=\"margin-bottom: 15px; font-variant-numeric: normal; font-variant-east-asian: normal; font-weight: bold; font-stretch: normal; font-size: 20px; line-height: 28px; font-family: Arial, Helvetica, sans-serif; color: rgb(51, 51, 51); outline: none;\">Hiệu năng mạnh mẽ từ Snapdragon 732G 8 nhân</h3><p style=\"margin-block: 0px; text-rendering: geometricprecision; line-height: 1.5; font-family: Arial, Helvetica, sans-serif; font-size: 16px !important;\">Redmi Note 10 Pro hoạt động dưới sức mạnh con chip Snapdragon 732G 8 nhân của Qualcomm, chipset cho hiệu năng khủng, cung cấp khả năng xử lý tuyệt vời cho máy. Từ đây, smartphone tự hào vươn lên trở thành thiết bị mang khả năng gaming xuất sắc.</p>'),
(13, 'IPS LCD', '4GB', '64GB', 'Hexa-core', 'IOS', '5.9', '194 g', 'Camera kép 12MP', 'Không', '802.11ax Wi‑Fi 6 with 2x2 MIMO', '3110 mAh', '1 tháng', 'GPS/GNSS', 'Hỗ trợ 4G', '0000-00-00', '5.0', '', 'Quay video 4K ở tốc độ 24 fps, 30 fps hoặc 60 fps', '1', '');
INSERT INTO `chitietsanpham` (`Masanpham`, `Manhinh`, `RomRam`, `Bonhotrong`, `CPU`, `Hedieuhanh`, `Kichthuoc`, `Trongluong`, `Camera`, `Thenho`, `Wifi`, `Pin`, `BaoHanh`, `GPS`, `Mang`, `NgaySX`, `Bluetooth`, `Audio`, `Video`, `Tinhtrang`, `Mota`) VALUES
(14, 'Dynamic AMOLED', '16GB', '128GB', 'Octa-core (2x2.73 GHz Mongoose M5 & 2x2.50 GHz Cortex-A', 'Android', '6.9', '208 g', 'AI Camera Ban đêm (Night Mode) Chuyên nghiệp (Pro) Chạm', 'Có hỗ trợ', 'Wi-Fi 802.11 a/b/g/n/ac/6, dual-band, Wi-Fi Direct, hot', 'Non-removable Li-Ion 4500 mAh battery Fast charging 25W', '3 tháng sau khi mua sản phẩm', 'A-GPS, GLONASS, BDS, GALILEO', 'Hỗ trợ 4G,5G', '2020-11-23', '5.0, A2DP, LE, aptX', 'Mới nhất hiện nay', 'Trước: 4K@30/60fps, 1080p@30fps Sau: 8K@24fps, 4K@30/60', '1', '<h2 style=\"margin-top: 0px; margin-bottom: 0.5rem; font-family: sans-serif; font-weight: 700; line-height: 1.2; color: rgb(10, 38, 60); font-size: 21px; text-align: justify;\"><strong>Điện thoại Samsung Note 20 Ultra 5G - Sang trọng, hiệu năng vượt trội</strong></h2><p style=\"font-size: 15px; line-height: 1.5; color: rgb(68, 68, 68); font-family: sans-serif; text-align: justify;\">Bên cạnh biên bản Galaxy Note 20 thường, Samsung còn cho ra mắt&nbsp;<strong>Note 20 Ultra 5G</strong>&nbsp;cho khả năng kết nối dữ liệu cao cùng thiết kế nguyên khối sang trọng, bắt mắt. Đây sẽ là sự lựa chọn hoàn hảo dành cho bạn để sử dụng mà không bị lỗi thời sau thời gian dài ra mắt.</p><p style=\"font-size: 15px; line-height: 1.5; color: rgb(68, 68, 68); font-family: sans-serif; text-align: justify;\">Ngoài ra, bạn có thể tham khảo&nbsp;<a href=\"https://cellphones.com.vn/samsung-galaxy-z-fold-3.html\" style=\"color: rgb(215, 0, 24);\">Galaxy Z Fold 3 5G</a>&nbsp;nếu bạn cần sự khác biệt và khẳng định đẳng cấp.</p><h3 style=\"margin-top: 0px; margin-bottom: 0.5rem; font-family: sans-serif; line-height: 1.2; color: rgb(10, 38, 60); font-size: 1.75rem; text-align: justify;\"><strong>Thiết kế khung nhôm nguyên khối, mặt sau kính cường lực sang trọng</strong></h3><p style=\"font-size: 15px; line-height: 1.5; color: rgb(68, 68, 68); font-family: sans-serif; text-align: justify;\">Là một sản phẩm có kích thước màn hình lớn vì vậy Samsung đã trang bị cho Galaxy Note 20 Ultra 5G&nbsp; với công nghệ kết nối dữ liệu mạnh mẽ cùng thiết kế nguyên khối. Giúp các linh kiện bên trong điện thoại được cố định chắc chắn đảm bảo mọi thứ bên trong luôn được an toàn. Không những vậy khung nhôm tạo trên những đường viền cực kỳ sang trọng và bắt mắt khi nhìn vào.</p><p style=\"font-size: 15px; line-height: 1.5; color: rgb(68, 68, 68); font-family: sans-serif; text-align: justify;\">Mặt sau của SS Galaxy Note này được hãng trang bị mặt kính tạo nên vẻ sang trọng và cuốn hút khi nhìn vào chiếc điện thoại từ bên ngoài. Loại kính cho cả mặt trước và mặt sau đều là kính cường lực Gorilla Glass 6 không những sang trọng mà còn mang đến sự chắc chắn hạn chế rơi vỡ vực tốt.</p><p style=\"text-align: center; font-size: 15px; line-height: 1.5; color: rgb(68, 68, 68); font-family: sans-serif;\"><img src=\"data:image/png;base64,\" style=\"width: 50%;\" data-filename=\"image.png\"><br></p><h3 style=\"margin-top: 0px; margin-bottom: 0.5rem; font-family: sans-serif; line-height: 1.2; color: rgb(10, 38, 60); font-size: 1.75rem; text-align: justify;\"><strong>Màn hình 6.9 inch độ phân giải 2K 120Hz, cấu hình mạnh mẽ</strong></h3><p style=\"font-size: 15px; line-height: 1.5; color: rgb(68, 68, 68); font-family: sans-serif; text-align: justify;\">Đối với bất kỳ chiếc điện thoại nào đến từ Samsung dòng Note luôn là những chiếc điện thoại có kích thước màn hình lớn. Samsung Galaxy Note 20 Ultra 5G cũng vậy nó được trang bị màn hình 6.9 inch 2 cạnh bên cong tạo nên vẻ đẹp sang trọng, độ phân giải đạt 2K 1440 x 3200 pixels cho hình ảnh hiển thị cực kỳ sắc nét. Ngoài ra tần số quét trên màn hình cũng nằm ở mức lớn 120Hz ở độ phân giải FHD và 60Hz ở QHD. Mọi hình ảnh khi bạn chơi game với khung hình cao hay trải nghiệm những bộ phim hành động cực kỳ mượt mà và sắc nét với công nghệ HDR10+.</p><p style=\"font-size: 15px; line-height: 1.5; color: rgb(68, 68, 68); font-family: sans-serif; text-align: justify;\"><strong>Samsung Note 20 Ultra 5G</strong>&nbsp;sở hữu bên trong một cấu hình cực kỳ mạnh mẽ cân dư sức các tựa game nặng nhất hiện nay. Máy sử dụng chip Exynos 992 tốc độ siêu nhanh đi kèm bộ nhớ RAM 12GB cho bộ nhớ 256GB giúp người dùng có thể thoải mái sử dụng đa nhiệm và lưu trữ thoải mái. Tất cả tạo nên một cấu hình cực kỳ mạnh mẽ có thể đáp ứng mọi nhu cầu của bạn trên một chiếc điện thoại.<br></p>');
INSERT INTO `chitietsanpham` (`Masanpham`, `Manhinh`, `RomRam`, `Bonhotrong`, `CPU`, `Hedieuhanh`, `Kichthuoc`, `Trongluong`, `Camera`, `Thenho`, `Wifi`, `Pin`, `BaoHanh`, `GPS`, `Mang`, `NgaySX`, `Bluetooth`, `Audio`, `Video`, `Tinhtrang`, `Mota`) VALUES
(15, 'Dynamic AMOLED', '16GB', '128GB', '2 nhân 2.73 GHz, 2 nhân 2.6 GHz & 4 nhân 2.0 GHz', 'Android', '6.9', '222 g', '4K@30/60fps, 1080p@30fps', 'Có hỗ trợ', 'Wi-Fi 802.11 a/b/g/n/ac/ax, dual-band, Wi-Fi Direct, ho', 'Li-Po 5000 mAh', '1 tháng sau khi mua sản phẩm', 'A-GPS, GLONASS, BDS, GALILEO', 'Hỗ trợ 4G', '2020-11-23', '5.0, A2DP, LE, aptX', 'Mới nhất hiện nay', '8K@24fps, 4K@30/60fps, 1080p@30/60/240fps, 720p@960fps,', '2', '<h2 style=\"margin-top: 0px; margin-bottom: 0.5rem; font-family: sans-serif; font-weight: 700; line-height: 1.2; color: rgb(10, 38, 60); font-size: 21px; text-align: justify;\"><strong>Điện thoại Samsung S20 Ultra – Flagship thiết kế độc đáo, cấu hình cao</strong></h2><p style=\"font-size: 15px; line-height: 1.5; color: rgb(68, 68, 68); font-family: sans-serif; text-align: justify;\"><strong>Samsung Galaxy S20 Ultra</strong>&nbsp;là flagship mới của dòng Galaxy S sẽ được Samsung giới thiệu vào đầu năm 2020. Đây là phiên bản cao cấp nhất bên cạnh phiên bản thường và bản Plus. Điện thoại sẽ được trang bị những tính năng tuyệt vời, dung lượng pin lớn, màn hình được trang bị tần số quét 120Hz, camera chính có độ phân giải 108mp sẽ là những tính năng nổi bật nhất. Để tiết kiệm chi phí nhưng vẫn có thể trải nghiệm các tính năng cao cấp, tham khảo ngay&nbsp;<a href=\"https://cellphones.com.vn/samsung-galaxy-s20-fe.html\" style=\"color: rgb(215, 0, 24);\">điện thoại Samsung S20 FE</a>&nbsp;đang có mức giá cực hấp dẫn.</p><h3 style=\"margin-top: 0px; margin-bottom: 0.5rem; font-family: sans-serif; line-height: 1.2; color: rgb(10, 38, 60); font-size: 1.75rem; text-align: justify;\"><strong>Màn hình kích thước 6.9 inch với tần số quét 120Hz</strong></h3><p style=\"font-size: 15px; line-height: 1.5; color: rgb(68, 68, 68); font-family: sans-serif; text-align: justify;\">Về thiết kế, Samsung S20 Ultra có thiết kế tương tự&nbsp;<a href=\"https://cellphones.com.vn/samsung-galaxy-s20.html\" target=\"_blank\" style=\"color: rgb(215, 0, 24);\">Samsung S20</a>&nbsp;và S20 Plus. Mặt trước máy được trang bị màn hình cong 6.9 inch với tấm nền&nbsp;<span style=\"color: rgb(51, 51, 0);\">AMOLED</span><a href=\"https://www.lifewire.com/super-amoled-4151073\" rel=\"nofollow\" title=\"Tấm nền Super AMOLED\" target=\"_blank\" style=\"color: rgb(215, 0, 24);\">&nbsp;</a>và độ phân giải FullHD. Các cạnh máy được vát nhẹ cho khả năng cầm nắm tốt. Phần camera trước của S20 Ultra sẽ được làm theo dạng đục lỗ thường thấy trên các mẫu smartphone Samsung gần đây. Ngoài ra, màn hình có tần số quét lên đến 120Hz. Đây cũng là mẫu smartphone đầu tiên được Samsung trang bị màn hình có tần số quét cao như vậy. Với mức tần số quét này, máy sẽ cho độ nhạy cảm ứng cao hơn, các thao tác vuốt chạm sẽ mượt mà và chân thực hơn, độ trễ giữa các thao tác là rất ít. Ngoài ra, bạn sẽ dễ dàng cảm nhận sự thay đổi này khi chơi các game yêu cầu đồ họa cao.</p><p style=\"text-align: center; font-size: 15px; line-height: 1.5; color: rgb(68, 68, 68); font-family: sans-serif;\"><img src=\"data:image/jpeg;base64,\" style=\"width: 50%;\"></p><p style=\"font-size: 15px; line-height: 1.5; color: rgb(68, 68, 68); font-family: sans-serif; text-align: justify;\">Mặt sau của máy được làm bằng kính sang trọng. Máy cũng được trang bị công nghệ cảm biến vân tay âm màn hình.Cụm 4 camera và đèn led sẽ nằm bên ở góc bên trái thay vì nằm ngang như trên Samsung Galaxy S10 năm nay. Ngoài ra, Galaxy S20 Ultra chỉ giữ lại cổng&nbsp;<span style=\"color: rgb(51, 51, 0);\">USB Type-C</span>&nbsp;và cụm loa ngoài ở cạnh dưới của máy. Cụm phím tăng giảm âm lượng và phím trợ lý ảo Bixby được thiết kế bên tay phải thay vì bên trái như trên Galaxy Note 10. Máy sẽ bị loại bỏ jack tai nghe 3.5mm.</p><h3 style=\"margin-top: 0px; margin-bottom: 0.5rem; font-family: sans-serif; line-height: 1.2; color: rgb(10, 38, 60); font-size: 1.75rem; text-align: justify;\"><strong>Camera chính có độ phân giải đến 108MP và zoom quang 5X</strong></h3><p style=\"font-size: 15px; line-height: 1.5; color: rgb(68, 68, 68); font-family: sans-serif; text-align: justify;\"><strong>Samsung S20 Ultra</strong>&nbsp;được trang bị cụm 4 camera sau lần lượt là camera góc rộng 108MP, camera góc siêu rộng 12MP, ống kính tele 48MP và ToF 0.3MP. Điện thoại mang đến khả năng zoom quang học tới 10 lần. Nhờ đó bạn có thể ghi lại mọi khoảnh khắc. Trong điều kiện thiếu sáng, máy cũng cho ra chất lượng ảnh tốt. Với cơ chế chụp nhiều ảnh cùng lúc sau đó hợp nhất, giúp giảm độ mờ, nhiễu.</p><h3 style=\"margin-top: 0px; margin-bottom: 0.5rem; font-family: sans-serif; line-height: 1.2; color: rgb(10, 38, 60); font-size: 1.75rem; text-align: justify;\"><strong style=\"font-size: 1.17em;\">Hiệu năng ấn tượng với 12GB RAM cùng chip Exynos 990</strong></h3><p style=\"font-size: 15px; line-height: 1.5; color: rgb(68, 68, 68); font-family: sans-serif; text-align: justify;\"><strong>Galaxy S20 Ultra</strong>&nbsp;sẽ được trang bị cấu hình mạnh nhất. Máy sẽ sử dụng chip Exynos 990. Đây là con chip do SamSung sản xuất có thể xứ lý mượt mà các game nặng và mới nhất hiện nay. Kèm theo đó là khả năng đáp ứng đồ họa cao. Máy cũng được trang bị dung lượng RAM lên đến 12GB cho phép xử lý các tác vụ đa nhiệm mà không phải tải lại ứng dụng. Đây sẽ là mức dung lượng RAM cao nhất trên các dòng điện thoại Samsung hiện nay.</p><div><br></div>'),
(16, '720 x 1600 pixel', '4GB', '64GB', '8 nhân Cortex-A53 tốc độ 1.8GHz', ' ', '6.5', '196 g', '720p@30fps', 'MicroSD, hỗ trợ lên đến 1TB', 'Wi-Fi 802.11 b/g/n, Wi-Fi Direct, hotspot', 'Li-Po 5000 mAh', '3 tháng sau khi mua sản phẩm', 'Có, hỗ trợ A-GPS, GLONASS, GALILEO, BDS', '4G,5G', '2020-05-02', '4.2, A2DP', 'Mới nhất hiện nay', '1080p@30fps', '1', '<h2 style=\"margin-top: 0px; margin-bottom: 0.5rem; font-family: sans-serif; font-weight: 700; line-height: 1.2; color: rgb(10, 38, 60); font-size: 21px;\">Điện thoại <strong>Samsung Galaxy A02s – Pin khủng 5.000mAh, cấu hình ổn định</strong></h2><p style=\"font-size: 15px; line-height: 1.5; color: rgb(68, 68, 68); font-family: sans-serif;\"><strong>Samsung A02s</strong> thuộc dòng smartphone giá rẻ của nhà Samsung và là chiếc smartphone kế nhiệm của chiếc Galaxy A01. Máy có thiết kế đơn giản nhưng vẫn chinh phục người dùng nhờ cấu hình ổn định trong tầm giá cùng viên pin dung lượng 5000mAh siêu trâu để bạn thoải sử dụng smartphone với cường độ cao.</p><p style=\"font-size: 15px; line-height: 1.5; color: rgb(68, 68, 68); font-family: sans-serif;\">Ngoài ra, bạn cũng có thể tham khảo thêm <a href=\"https://cellphones.com.vn/samsung-galaxy-a03s.html\" style=\"color: rgb(215, 0, 24);\">điện thoại Samsung Galaxy A03s</a> với nhiều nâng cấp hơn.</p><h3 style=\"margin-top: 0px; margin-bottom: 0.5rem; font-family: sans-serif; line-height: 1.2; color: rgb(10, 38, 60); font-size: 1.75rem;\"><strong>Thiết kế đơn giản nhưng tinh tế và màn hình giọt nước 6.5 inch HD+</strong></h3><p style=\"font-size: 15px; line-height: 1.5; color: rgb(68, 68, 68); font-family: sans-serif;\">Điện thoại Galaxy A02s có thiết kế đơn giản và cũng mang ngôn ngữ thiết kế tương tự với các phiên bản giá rẻ trước như như Samsung Galaxy A01.</p><p style=\"font-size: 15px; line-height: 1.5; color: rgb(68, 68, 68); font-family: sans-serif;\">Sở hữu màn hình kích thước 6.5 inch với notch giọt nước phù hợp với xu hướng hiện nay mang đến Galaxy A02s cái nhìn trẻ trung và tinh tế hơn. Bên cạnh đó màn hình còn có độ phân giải HD+ mang đến khung hình sắc nét và màu sắc sống động.</p><p style=\"text-align: center; font-size: 15px; line-height: 1.5; color: rgb(68, 68, 68); font-family: sans-serif;\"><img src=\"https://cdn.cellphones.com.vn/media/wysiwyg/mobile/samsung/samsung-galaxy-a02s-1_1.jpg\" style=\"width: 840px;\"></p><p style=\"font-size: 15px; line-height: 1.5; color: rgb(68, 68, 68); font-family: sans-serif;\">Mặc dù màn hình chỉ có kích thước 6.5 inch nhưng với công nghệ tràn viền 2 cạnh bên, smartphone vẫn mang đến hình ảnh đủ lớn trong một kích thước vừa tay, cầm nắm thoải mái.</p><h3 style=\"margin-top: 0px; margin-bottom: 0.5rem; font-family: sans-serif; line-height: 1.2; color: rgb(10, 38, 60); font-size: 1.75rem;\"><strong>Cụm 3 camera hình chữ nhật với cảm biến 13MP và 2MP - 2mp, camera trước 5MP</strong></h3><p style=\"font-size: 15px; line-height: 1.5; color: rgb(68, 68, 68); font-family: sans-serif;\">Samsung Galaxy A02s có cụm camera hình chữ nhật độc đáo và hiện đại như các thiết kế của dòng smartphone cao cấp nhà Samsung.</p><p style=\"font-size: 15px; line-height: 1.5; color: rgb(68, 68, 68); font-family: sans-serif;\">Cụm ba camera với camera chính 13MP và camera đo độ sâu 2MP, camera macro 2MP cho khả năng chụp ảnh sắc nét và cho màu sắc sống động. Ngoài ra smartphone cũng hỗ trợ đầy đủ các tính năng chụp ảnh thông minh như xóa phông, panorama, HDR,….</p><p style=\"font-size: 15px; line-height: 1.5; color: rgb(68, 68, 68); font-family: sans-serif;\">Camera selfie với độ cảm biến 5MP và hỗ trợ làm đẹp Beautify mang đến cho bạn những bức ảnh selfie đẹp nhất. Ngoài ra với độ cảm biến cao nên bạn có thể tận hưởng các cuộc gọi video với chất lượng HD sắc nét.</p><h3 style=\"margin-top: 0px; margin-bottom: 0.5rem; font-family: sans-serif; line-height: 1.2; color: rgb(10, 38, 60); font-size: 1.75rem;\"><strong>Cấu hình ổn định trong tầm giá với chip Snapdragon 450 và RAM 4GB</strong></h3><p style=\"font-size: 15px; line-height: 1.5; color: rgb(68, 68, 68); font-family: sans-serif;\">Mặc dù là smartphone thuộc phân khúc giá rẻ nhưng Samsung vẫn trang bị cho <strong>Galaxy A02s</strong> cấu hình khá tốt và ổn định so với tầm giá.</p><p style=\"font-size: 15px; line-height: 1.5; color: rgb(68, 68, 68); font-family: sans-serif;\">Sử dụng chip Qualcomm Snapdragon 450 tám nhân với vi xử lý GPU Adreno 506 cho hiệu năng ấn tượng, xử lý tốt và mượt mà các thao tác tác vụ, chơi tốt các game hot trên thị trường.</p><h3 style=\"margin-top: 0px; margin-bottom: 0.5rem; font-family: sans-serif; line-height: 1.2; color: rgb(10, 38, 60); font-size: 1.75rem;\"><strong>Kết nối WiFi chuẩn 802.11 b/g/n đầy đủ tính năng, hỗ trợ kết nối Bluetooth v4.2</strong></h3><p style=\"font-size: 15px; line-height: 1.5; color: rgb(68, 68, 68); font-family: sans-serif;\">Samsung A02s vẫn hỗ trợ đầy đủ các kết nối không dây như kết nối WiFi chuẩn 802.11 b/g/n với đầy đủ các chức năng như WiFi Direct, WiFi hotspot,…nên bạn cũng có thể thiết lập smartphone như một thiết bị phát WiFi di động, chia sẻ mạng với các thiết bị khác.</p><p style=\"font-size: 15px; line-height: 1.5; color: rgb(68, 68, 68); font-family: sans-serif;\">Kết nối Bluetooth v4.2 ổn định và mạnh mẽ, chia sẻ dữ liệu với các thiết bị khác thông qua Bluetooth một cách nhanh chóng và hiệu quả. Bên cạnh đó kết nối Bluetooth còn giúp bạn kết nối với các phụ kiện không dây như tai nghe, loa,…để mang đến trải nghiệm tốt hơn.</p><h3 style=\"margin-top: 0px; margin-bottom: 0.5rem; font-family: sans-serif; line-height: 1.2; color: rgb(10, 38, 60); font-size: 1.75rem;\"><strong>Pin dung lượng khủng 5000mAh đáp ứng thời lượng sử dụng cường độ cao</strong></h3><p style=\"font-size: 15px; line-height: 1.5; color: rgb(68, 68, 68); font-family: sans-serif;\">Một điểm cộng được nhiều người dùng yêu thích chính là dung lượng pin của smartphone. Với mức dung lượng khủng đến 5000mAh, Samsung Galaxy A02s dư sức mang đến thời lượng sử dụng suốt cả một ngày.</p><p style=\"font-size: 15px; line-height: 1.5; color: rgb(68, 68, 68); font-family: sans-serif;\">Bên cạnh đó, Samsung cũng trang bị công nghệ sạc nhanh 15W tiêu chuẩn để bạn có thể nạp pin cho thiết bị nhanh chóng khi hết pin.</p>'),
(17, '720 x 1480 pixels', '1GB', '16GB', 'Quad-core 1.5 GHz Cortex-A53', 'Android', '5.3', '150 g (5.29 oz)', '1080p@30fps', 'microSDXC', 'Wi-Fi 802.11 b/g/n, Wi-Fi Direct, hotspot', 'Li-Ion 3000 mAh battery', '1 tháng sau khi mua sản phẩm', 'A-GPS', 'Hỗ trợ 4G,5G', '2020-11-01', '5.0, A2DP, LE', 'Có (microphone chuyên dụng chống ồn)', '1080p@30fps', '2', '<h2 style=\"margin-top: 0px; margin-bottom: 0.5rem; font-family: sans-serif; font-weight: 700; line-height: 1.2; color: rgb(10, 38, 60); font-size: 21px;\"><strong>Điện thoại Samsung Galaxy A01 Core – Thiết kế truyền thống 1 camera sau</strong></h2><p style=\"font-size: 15px; line-height: 1.5; color: rgb(68, 68, 68); font-family: sans-serif;\">Hiện nay, những dòng smartphone hiện đại trên thị trường đều đi theo xu hướng thiết kế với hệ thống camera kép, ba camera, bốn camera,… để người dùng thỏa sức ghi lại những khoảnh khắc đáng nhớ. Chính vì thế, Samsung đã mang đến sự khác biệt khi cho ra mắt chiếc smartphone thuộc dòng Samsung Galaxy A có thiết kế truyền thống chỉ 1 camera sau và cấu hình ổn định, mang đến trải nghiệm tuyệt vời trong một mức giá vô cùng phải chăng với tên gọi&nbsp;<strong>Samsung Galaxy A01 Core</strong>.</p><h3 style=\"margin-top: 0px; margin-bottom: 0.5rem; font-family: sans-serif; line-height: 1.2; color: rgb(10, 38, 60); font-size: 1.75rem;\"><strong>Thiết kế đơn giản với vỏ ngoài bằng nhựa cao cấp, mặt lưng họa tiết vân sọc ngang</strong></h3><p style=\"font-size: 15px; line-height: 1.5; color: rgb(68, 68, 68); font-family: sans-serif;\">Vì là dòng smartphone giá rẻ nên Samsung A01 Core có thiết kế cũng khá đơn giản nhưng vẫn rất tinh tế với các góc cạnh bo tròn và các đường nét thanh lịch.&nbsp;<a href=\"https://cellphones.com.vn/samsung-galaxy-a01.html\" style=\"color: rgb(215, 0, 24);\">Điện thoại Samsung A01</a>&nbsp;Core có vỏ ngoài và khung máy được làm bằng nhựa cứng cao cấp giúp máy có trọng lượng nhẹ nhưng vẫn có độ bền cao. Mặt sau của máy được thiết kế với họa tiết vân sọc ngang để tạo cảm giác cầm chắc chắn hơn cũng như tạo điểm nhấn cho mặt lưng.</p><p style=\"text-align: center; font-size: 15px; line-height: 1.5; color: rgb(68, 68, 68); font-family: sans-serif;\"><img src=\"data:image/jpeg;base64,\" style=\"width: 50%;\"></p><p style=\"font-size: 15px; line-height: 1.5; color: rgb(68, 68, 68); font-family: sans-serif;\">Chiếc smartphone giá rẻ Galaxy A01 Core sẽ có ba phiên bản màu là Đen, Đỏ và Xanh dương để người dùng có thể tìm được phiên bản màu sắc yêu thích. Ngoài ra, bề mặt điện thoại được sơn nhám để giúp thiết bị có khả năng chống trầy tốt hơn, hạn chế bám dấu vân tay.</p><h3 style=\"margin-top: 0px; margin-bottom: 0.5rem; font-family: sans-serif; line-height: 1.2; color: rgb(10, 38, 60); font-size: 1.75rem;\"><strong>Màn hình LCD 5.14 inch với độ phân giải HD 720 x 1480 pixels hiển thị rõ nét</strong></h3><p style=\"font-size: 15px; line-height: 1.5; color: rgb(68, 68, 68); font-family: sans-serif;\">Galaxy A01 Core được trang bị màn hình có kích thước 5.14 inch, không quá to nhưng cũng không quá nhỏ, giúp smartphone có kích thước vừa tay người dùng hơn nhưng vẫn mang đến không gian hiển thị tốt. Màn hình A01 Core tích hợp cảm ứng đa điểm, màn hình 16 triệu màu cho khả năng cảm ứng mượt và nhạy cùng hình ảnh hiển thị có màu sắc sống động.</p><p style=\"font-size: 15px; line-height: 1.5; color: rgb(68, 68, 68); font-family: sans-serif;\">Màn hình vẫn đạt độ phân giải HD 720 x 1480 pixels, tỉ lệ màn hình 18.5:9 và 320ppi để mang đến không gian hiển thị sắc nét, mang đến cho người dùng những trải nghiệm tuyệt vời với hình ảnh tươi sáng. Với Galaxy A01 Core, bạn có thể thoải mái tận hưởng những bộ phim hay, lướt web, chơi game,....</p><h3 style=\"margin-top: 0px; margin-bottom: 0.5rem; font-family: sans-serif; line-height: 1.2; color: rgb(10, 38, 60); font-size: 1.75rem;\"><strong>Chip MediaTek MT6739WW, RAM 1GB, bộ nhớ trong 8GB hỗ trợ thẻ nhớ microSDXC thỏa sức lưu trữ</strong></h3><p style=\"font-size: 15px; line-height: 1.5; color: rgb(68, 68, 68); font-family: sans-serif;\">Để mang đến hiệu năng ổn định với mức giá phải chăng, Samsung đã trang bị cho mẫu smartphone bình dân của mình con chip MediaTek MT6739WW 4 nhân với tốc độ xử lý lên đến 1.5GHz. Con chip được xây dựng trên tiến trình 28nm nên vẫn mang đến sức mạnh ổn định trong một thiết kế mỏng nhẹ.</p><div><p style=\"font-size: 15px; line-height: 1.5; color: rgb(68, 68, 68); font-family: sans-serif;\">Ngoài ra, Samsung Galaxy A01 Core cũng được trang bị RAM có dung lượng vừa đủ dùng 1GB giúp máy có thể xử lý mượt mà các thao tác tác vụ, chạy đa nhiệm ổn định và chơi tốt các tựa game đồ họa trung bình. Máy có bộ nhớ trong 8GB nên bạn có thể lưu trữ được nhiều tập tin hình ảnh, âm thanh, video,…và cài đặt được nhiều ứng dụng. Bên cạnh đó, máy vẫn hỗ trợ thẻ nhớ ngoài microSDXC để người dùng có thể nâng cao khả năng lưu trữ của máy, giúp bạn lưu trữ được nhiều hơn.</p><h3 style=\"margin-top: 0px; margin-bottom: 0.5rem; font-family: sans-serif; line-height: 1.2; color: rgb(10, 38, 60); font-size: 1.75rem;\"><strong>Kiểu dáng truyền thống với 1 camera 8MP và camera 5MP chụp ảnh sắc nét</strong></h3><p style=\"font-size: 15px; line-height: 1.5; color: rgb(68, 68, 68); font-family: sans-serif;\">Khác với những mẫu smartphone đa camera trên thị trường,&nbsp;<strong>Samsung A01 Core</strong>&nbsp;chỉ sở hữu 1 camera sau duy nhất với độ cảm biến 8MP có hỗ trợ LED Flash giúp bạn ghi lại những khoảnh khắc đáng nhớ. Ngoài ra, camera cũng hỗ trợ tính năng lấy nét tự động để mang đến ảnh chụp có chất lượng tốt hơn.</p></div>'),
(18, 'Super AMOLED', '16GB', '128GB', '8 nhân (1x2.84 GHz Kryo 585 & 3x2.42 GHz Kryo 585 & 4x1', 'Android', '6.5', '190 g', 'Camera chính: 12 MP, f/1.8 Camera tele: 8 MP, f/2.0, zo', 'MicroSD, hỗ trợ lên đến 1TB', 'Wi-Fi 802.11 a/b/g/n/ac/6, dual-band, Wi-Fi Direct, hot', 'Li-Po 4500 mAh, sạc nhanh 25W, sạc không dây cho các th', '3 tháng sau khi mua sản phẩm', 'A-GPS, GLONASS, BDS, GALILEO', 'Hỗ trợ 4G,5G', '2021-02-11', '5.0, A2DP, LE', 'Mới nhất hiện nay', 'Trước: 4K, 1080p Sau: 8K, 4K, 1080p, gyro-EIS', '1', '<h2 style=\"margin-top: 0px; margin-bottom: 0.5rem; font-family: sans-serif; font-weight: 700; line-height: 1.2; color: rgb(10, 38, 60); font-size: 21px; text-align: justify;\">Điện thoại Samsung Galaxy S20 FE - Phiên bản đặc biệt dành cho fan Samsung</h2><p style=\"font-size: 15px; line-height: 1.5; color: rgb(68, 68, 68); font-family: sans-serif; text-align: justify;\"><strong>Samsung S20 FE</strong>&nbsp;là chiếc điện thoại sắp được ra mắt từ Samsung, với chữ FE đằng sau tên gọi của máy có nghĩa là Fan Edition. Đây là dòng điện thoại ra mắt như để gửi lời tri ân đến các fan trung thành đã và đang sử dụng các sản phẩm của Samsung. Với số lượng sản phẩm được giới hạn và chỉ mở bán trong thời gian ngắn.&nbsp;&nbsp;</p><h3 style=\"margin-top: 0px; margin-bottom: 0.5rem; font-family: sans-serif; line-height: 1.2; color: rgb(10, 38, 60); font-size: 1.75rem; text-align: justify;\">Màn hình Super Amoled 6.5 inch, FullHD, công nghệ HDR10+, tần số quét 120Hz</h3><p style=\"font-size: 15px; line-height: 1.5; color: rgb(68, 68, 68); font-family: sans-serif; text-align: justify;\">Được định hướng vẫn là sản phẩm ở phân khúc cao cấp, Galaxy S20&nbsp;Fan Edition&nbsp;được trang bị tấm nền Super Amoled cao cấp, kích thước màn hình lớn lên đến 6.5 inches, màn hình độ phân giải FullHD giúp hình ảnh hiển thị trên chiếc điện thoại này là vô cùng sắc nét và rực rỡ.</p><p style=\"text-align: center; font-size: 15px; line-height: 1.5; color: rgb(68, 68, 68); font-family: sans-serif;\"><img src=\"https://cdn.cellphones.com.vn/media/wysiwyg/mobile/samsung/samsung-galaxy-s20-fe-1_1.jpg\" style=\"width: 840px;\"></p><p style=\"font-size: 15px; line-height: 1.5; color: rgb(68, 68, 68); font-family: sans-serif; text-align: justify;\">Không bỏ lỡ trào lưu tần số quét cao, điện thoại được trang bị một màn hình với tần số quét 120Hz, công nghệ hình ảnh HDR10+ tăng độ tương phản, giúp bạn có những phút giây giải trí hoàn hảo dù là chơi game hay xem phim.</p><h3 style=\"margin-top: 0px; margin-bottom: 0.5rem; font-family: sans-serif; line-height: 1.2; color: rgb(10, 38, 60); font-size: 1.75rem; text-align: justify;\">Hiệu năng mạnh mẽ với chip Snapdragon 865, chuẩn bộ nhớ UFS 3.1</h3><p style=\"font-size: 15px; line-height: 1.5; color: rgb(68, 68, 68); font-family: sans-serif; text-align: justify;\">Trái tim của Galaxy S20 FE chính là bộ vi xử lý&nbsp;Snapdragon 865 8 nhân giúp máy hoạt động mạnh mẽ, nhưng vẫn tiết kiệm được pin nhờ áp dụng tiến trình sản xuất nhỏ hơn.</p><div><p style=\"font-size: 15px; line-height: 1.5; color: rgb(68, 68, 68); font-family: sans-serif; text-align: justify;\">Ngoài ra chuẩn bộ nhớ UFS 3.1 mới nhất cho tốc độ đọc ghi lần lượt là 2100Mb/s, 1200Mb/s. Ấn tượng nhất trong phân khúc các điện thoại đầu bảng hiện này, giúp Samsung Galaxy S20 Fan Edition có thể load các ứng dụng hay trao đổi file trên máy tính nhanh chóng hơn.</p><h3 style=\"margin-top: 0px; margin-bottom: 0.5rem; font-family: sans-serif; line-height: 1.2; color: rgb(10, 38, 60); font-size: 1.75rem; text-align: justify;\">Camera 12MP hỗ trợ quay phim 8K, zoom quang 3X</h3><p style=\"font-size: 15px; line-height: 1.5; color: rgb(68, 68, 68); font-family: sans-serif; text-align: justify;\"><strong>Galaxy S20 FE</strong>&nbsp;thừa hưởng cụm camera từ người đàn anh Samsung Galaxy S20 với cụm 3 camera với camera chính 12MP hỗ trợ quay phim lên đến 8K kèm khả năng chống rung quang OIS kết hợp với chống rung điện tử EIS.</p></div><div><p style=\"font-size: 15px; line-height: 1.5; color: rgb(68, 68, 68); font-family: sans-serif; text-align: justify;\">Điểm đặc biệt tiếp theo là hỗ trợ mạng 4G, cho phép Samsung Galaxy S20 FE đón đầu xu hướng, khi mà tại Việt Nam các nhà mạng đã cho phép thử nghiệm băng tần mạng thế hệ mới này.</p><h3 style=\"margin-top: 0px; margin-bottom: 0.5rem; font-family: sans-serif; line-height: 1.2; color: rgb(10, 38, 60); font-size: 1.75rem; text-align: justify;\">Sạc nhanh 25W, viên pin dung lượng&nbsp;lớn&nbsp;4500mAh</h3><p style=\"font-size: 15px; line-height: 1.5; color: rgb(68, 68, 68); font-family: sans-serif; text-align: justify;\"><strong>S20 FE</strong>&nbsp;sở hữu viên pin dung lượng lớn 4500mAh, màn hình AMOLED tiết kiệm điện giúp máy có thể sử dụng cả ngày dài mà không lo lắng về vấn đề hết pin trên chiếc điện thoại này.</p></div>'),
