(29, 'Màn hình super Retina XDR, OLED, 460 ppi, HDR display, ', '64GB', '128GB', 'Octa-core (2x2.73 GHz Mongoose M5 & 2x2.50 GHz Cortex-A', 'IOS', '5.9', '194 g', 'Camera góc rộng: 12MP, f/1.6 Camera góc siêu rộng: 12MP', 'MicroSD, hỗ trợ lên đến 1TB', 'Wi-Fi 802.11 a/b/g/n/ac/6, dual-band, Wi-Fi Direct, hot', '3110 mAh', '3 tháng sau khi mua sản phẩm', 'GPS/GNSS', 'Hỗ trợ 4G,5G', '2021-11-29', '5.0, A2DP, LE, aptX', 'Mới nhất hiện nay', '4K 2160p@30fps FullHD 1080p@30fps FullHD 1080p@60fps HD', '1', '<p style=\"font-size: 15px; line-height: 1.5; color: rgb(68, 68, 68); font-family: sans-serif; text-align: justify;\">Dù Apple vừa giới thiệu dòng&nbsp;<a href=\"https://cellphones.com.vn/mobile/apple/iphone-13.html\" style=\"color: rgb(215, 0, 24);\">điện thoại iPhone 13</a>&nbsp;series tuy nhiên&nbsp;<strong>iPhone 12</strong>&nbsp;vẫn đang là một trong những sự lựa chọn hàng đầu ở thời điểm hiện tại. Chiếc flagship năm 2020 của \"Táo khuyết\" đang nhận được rất nhiều sự quan tâm của người dùng bởi mức giá dễ tiếp cận hơn so với thời điểm ra mắt, đồng thời được trang bị cấu hình, màn hình, camera ấn tượng trong tầm giá.</p><h2 style=\"margin-top: 0px; margin-bottom: 0.5rem; font-family: sans-serif; font-weight: 700; line-height: 1.2; color: rgb(10, 38, 60); font-size: 21px; text-align: justify;\"><strong>Đánh giá iPhone 12 - Siêu phẩm khẳng định đẳng cấp</strong></h2><p style=\"font-size: 15px; line-height: 1.5; color: rgb(68, 68, 68); font-family: sans-serif; text-align: justify;\">Phiên bản iPhone 12 thường sở hữu nhiều điểm mới đặc biệt là về thiết kế và cấu hình so với các thế hệ trước đó.</p><h3 style=\"margin-top: 0px; margin-bottom: 0.5rem; font-family: sans-serif; line-height: 1.2; color: rgb(10, 38, 60); font-size: 1.75rem; text-align: justify;\"><strong>Thiết kế&nbsp;</strong></h3><p style=\"font-size: 15px; line-height: 1.5; color: rgb(68, 68, 68); font-family: sans-serif; text-align: justify;\">Điện thoại iPhone 12 gây ấn tượng với người dùng bởi thiết kế vuông vức quen thuộc, đây là thiết kế đã từng xuất hiện trên thế hệ iPhone 5 trước đó. Điện thoại được hoàn thiện mỏng hơn với cụm camera lớn hơn.</p><p style=\"font-size: 15px; line-height: 1.5; color: rgb(68, 68, 68); font-family: sans-serif; text-align: justify;\">Đặc biệt, máy được trang bị một khung viền thép không gỉ. Mặt lưng iPhone 12 được trang bị một mặt kính Ceramic Shield bóng bẩy, gây được sự chú ý của người đối diện.</p><p style=\"font-size: 15px; line-height: 1.5; color: rgb(68, 68, 68); font-family: sans-serif; text-align: justify;\">Về kích thước cụ thể, điện thoại iPhone 12 với thông số từng cạnh lần lượt là 146.7 x 71.5 x 7.4 mm cùng cân nặng khoảng 164g. Tổng thể, máy khá mỏng nhẹ thích hợp với cả người dùng nam và nữ cũng như thích hợp với nhiều kích thước tay khác nhau.</p><p style=\"text-align: center; font-size: 15px; line-height: 1.5; color: rgb(68, 68, 68); font-family: sans-serif;\"><img src=\"data:image/jpeg;base64,\" style=\"width: 50%;\"><br></p><h3 style=\"margin-top: 0px; margin-bottom: 0.5rem; font-family: sans-serif; line-height: 1.2; color: rgb(10, 38, 60); font-size: 1.75rem; text-align: justify;\"><strong>Màn hình&nbsp;</strong></h3><p style=\"font-size: 15px; line-height: 1.5; color: rgb(68, 68, 68); font-family: sans-serif; text-align: justify;\">Màn hình là một điểm nhấn trên iPhone 12. Máy được trang bị tấm nền Super Retina XDR OLED, thay vì IPS LCD như thế hệ trước đó nhờ vậy người dùng sẽ cảm nhận được khả năng hiển thị sinh động, màu sắc đậm đà cũng như độ tương phản cao.</p><p style=\"font-size: 15px; line-height: 1.5; color: rgb(68, 68, 68); font-family: sans-serif; text-align: justify;\">Bên cạnh đó, điện thoại được trang bị một màn hình kích thước khá lớn, tới 6.1 inch. Cùng với đó là độ phân giải 1.170 x 2.532 pixels nhờ đó mang lại khả năng hiển thị với hình ảnh đẹp mắt. Màn hình với tần số quét 60Hz mang lại trải nghiệm mượt mà, từ xem phim đến chơi game.</p><p style=\"font-size: 15px; line-height: 1.5; color: rgb(68, 68, 68); font-family: sans-serif; text-align: justify;\">Phần viền màn hình trên thế hệ iPhone 12 cũng nhỏ và mỏng hơn rất nhiều so với các thế thệ trước. Nhờ đó người dùng có không giản trải nghiệm rộng hơn, màn hình hiển thị được nhiều chi tiết hơn.</p><p style=\"font-size: 15px; line-height: 1.5; color: rgb(68, 68, 68); font-family: sans-serif; text-align: justify;\">Ngoài ra, màn hình trên thiết bị cũng được trang bị công nghệ True Tone giúp tự động điều chỉnh độ sáng màn hình theo độ sáng của môi trường giúp con mắt của người dùng thoải mái hơn khi sử dụng.</p><h3 style=\"margin-top: 0px; margin-bottom: 0.5rem; font-family: sans-serif; line-height: 1.2; color: rgb(10, 38, 60); font-size: 1.75rem; text-align: justify;\"><strong>Cấu hình&nbsp;</strong></h3><p style=\"font-size: 15px; line-height: 1.5; color: rgb(68, 68, 68); font-family: sans-serif; text-align: justify;\">Ngoài nhiều nâng cấp về thiết kế, cấu hình cũng là một điểm nâng cấp lớn. Cấu hình này giúp iPhone 12 trở thành là một trong những chiếc điện thoại mạnh mẽ nhất thời điểm ra mắt.</p><p style=\"font-size: 15px; line-height: 1.5; color: rgb(68, 68, 68); font-family: sans-serif; text-align: justify;\">Cụ thể, máy được trang bị con chip Apple A14 Bionic cùng dung lượng RAM 4GB cùng bộ nhớ trong 64GB (Bản tiêu chuẩn). Con chip A14 mới này được sản xuất trên tiến trình 5nm với hơn 11 tỷ bóng bán dẫn mang lại hiệu năng CPU tăng 40% và 30% GPU so với thế hệ trước.</p><p style=\"font-size: 15px; line-height: 1.5; color: rgb(68, 68, 68); font-family: sans-serif; text-align: justify;\">Cấu hình vượt trội này giúp thiết bị chiến tốt các tựa game hot trên thị trường như Liên Minh Huyền Thoại, Liên Quân Mobile, PUBG Mobile, Call Of Duty Mobile, Genshin Impact Mobile,…</p><p style=\"font-size: 15px; line-height: 1.5; color: rgb(68, 68, 68); font-family: sans-serif; text-align: justify;\">Ở các phần mềm chấm điểm hiệu năng, iPhone 12 cho điểm số khá ấn tượng. Cụ thể, điện thoại cho 592.383 điểm AnTuTu trong đó điểm CPU lên tới 182.690 điểm và GPU là 248.724 điểm.</p>');

